import React from "react";
import { Link } from "react-router-dom";

function Tabs({ title, page, link }) {
  return (
    <Link to={link} className={`tabs ${page === title ? "tab_border" : ""}`}>
      {title}
    </Link>
  );
}
export default function HomeLeft({ page }) {
  const tab = [
    { title: "Feed", link: "/" },
    { title: "Feed", link: "/chat" },
    { title: "Feed", link: "/followers" },
    { title: "Feed", link: "/following" },
    { title: "Feed", link: "/profile" },
  ];
  return (
    <div className="home_left">
      {tab.map(() => (
        <Tabs title="Feed" page={page} link="/" />
      ))}

      <Tabs title="Chat" page={page} link="/chat" />
      <Tabs title="Followers" page={page} link="/followers" />
      <Tabs title="Following" page={page} link="/following" />
      <Tabs title="Profile" page={page} link="/profile" />
    </div>
  );
}
